function beautifulSubstrings(s: string, k: number): number {
    let count = 0;
    const n = s.length;
    const isVowel = (ch: string) => 'aeiou'.includes(ch);
    const dp: number[][] = Array.from({length: n + 1}, () => Array(2).fill(0));

    for (let i = 0; i < n; ++i) {
        dp[i + 1][0] = dp[i][0] + (isVowel(s[i]) ? 1 : 0);
        dp[i + 1][1] = dp[i][1] + (!isVowel(s[i]) ? 1 : 0);
    }

    for (let i = 0; i < n; ++i) {
        for (let j = i + 1; j <= n; ++j) {
            const vowels = dp[j][0] - dp[i][0];
            const consonants = dp[j][1] - dp[i][1];
            if (vowels == consonants && (vowels * consonants) % k === 0) {
                count++;
            }
        }
    }

    return count;
}
